import React from 'react';
import { RadialBarChart, RadialBar, Legend } from 'recharts';
import '../../index.css'; 

const AverageScoreChart = ({ data }) => {
  return (
    <RadialBarChart width={600} height={300} cx={300} cy={150} innerRadius={20} outerRadius={140} barSize={10} data={data}>
      <RadialBar minAngle={15} label={{ position: 'insideStart', fill: '#fff' }} background clockWise={true} dataKey="score" />
      <Legend iconSize={10} layout="vertical" verticalAlign="middle" wrapperStyle={{}} />
    </RadialBarChart>
  );
};

export default AverageScoreChart;
